contracts/BytesUtils.sol.content:
// SPDX-License-Identifier: LGPL-3.0-or-later
pragma solidity ^0.6.0;

library BytesUtils {


    /* @notice      Convert bytes to address
    *  @param _bs   Source bytes: bytes length must be 20
    *  @return      Converted address from source bytes
    */
    function bytesToAddress(bytes memory _bs) internal pure returns (address addr)
    {
        require(_bs.length == 20, "bytes length does not match address");
        assembly {
        // for _bs, first word store _bs.length, second word store _bs.value
        // load 32 bytes from mem[_bs+20], convert it into Uint160, meaning we take last 20 bytes as addr (address).
            addr := mload(add(_bs, 0x14))
        }

    }

    /* @notice      Convert address to bytes
    *  @param _addr Address need to be converted
    *  @return      Converted bytes from address
    */
    function addressToBytes(address _addr) internal pure returns (bytes memory bs){
        assembly {
        // Get a location of some free memory and store it in result as
        // Solidity does for memory variables.
            bs := mload(0x40)
        // Put 20 (address byte length) at the first word, the length of bytes for uint256 value
            mstore(bs, 0x14)
        // logical shift left _a by 12 bytes, change _a from right-aligned to left-aligned
            mstore(add(bs, 0x20), shl(96, _addr))
        // Update the free-memory pointer by padding our last write location to 32 bytes
            mstore(0x40, add(bs, 0x40))
        }
    }



    /* @notice              Compare if two bytes are equal, which are in storage and memory, seperately
                            Refer from https://github.com/summa-tx/bitcoin-spv/blob/master/solidity/contracts/BytesLib.sol#L368
    *  @param _preBytes     The bytes stored in storage
    *  @param _postBytes    The bytes stored in memory
    *  @return              Bool type indicating if they are equal
    */
    function equalStorage(bytes storage _preBytes, bytes memory _postBytes) internal view returns (bool) {
        bool success = true;

        assembly {
        // we know _preBytes_offset is 0
            let fslot := sload(_preBytes_slot)
        // Arrays of 31 bytes or less have an even value in their slot,
        // while longer arrays have an odd value. The actual length is
        // the slot divided by two for odd values, and the lowest order
        // byte divided by two for even values.
        // If the slot is even, bitwise and the slot with 255 and divide by
        // two to get the length. If the slot is odd, bitwise and the slot
        // with -1 and divide by two.
            let slength := div(and(fslot, sub(mul(0x100, iszero(and(fslot, 1))), 1)), 2)
            let mlength := mload(_postBytes)

        // if lengths don't match the arrays are not equal
            switch eq(slength, mlength)
            case 1 {
            // fslot can contain both the length and contents of the array
            // if slength < 32 bytes so let's prepare for that
            // v. http://solidity.readthedocs.io/en/latest/miscellaneous.html#layout-of-state-variables-in-storage
            // slength != 0
                if iszero(iszero(slength)) {
                    switch lt(slength, 32)
                    case 1 {
                    // blank the last byte which is the length
                        fslot := mul(div(fslot, 0x100), 0x100)

                        if iszero(eq(fslot, mload(add(_postBytes, 0x20)))) {
                        // unsuccess:
                            success := 0
                        }
                    }
                    default {
                    // cb is a circuit breaker in the for loop since there's
                    //  no said feature for inline assembly loops
                    // cb = 1 - don't breaker
                    // cb = 0 - break
                        let cb := 1

                    // get the keccak hash to get the contents of the array
                        mstore(0x0, _preBytes_slot)
                        let sc := keccak256(0x0, 0x20)

                        let mc := add(_postBytes, 0x20)
                        let end := add(mc, mlength)

                    // the next line is the loop condition:
                    // while(uint(mc < end) + cb == 2)
                        for {} eq(add(lt(mc, end), cb), 2) {
                            sc := add(sc, 1)
                            mc := add(mc, 0x20)
                        } {
                            if iszero(eq(sload(sc), mload(mc))) {
                            // unsuccess:
                                success := 0
                                cb := 0
                            }
                        }
                    }
                }
            }
            default {
            // unsuccess:
                success := 0
            }
        }

        return success;
    }

    function equal(bytes memory _preBytes, bytes memory _postBytes) internal pure returns (bool) {
        bool success = true;

        assembly {
            let length := mload(_preBytes)

        // if lengths don't match the arrays are not equal
            switch eq(length, mload(_postBytes))
            case 1 {
            // cb is a circuit breaker in the for loop since there's
            //  no said feature for inline assembly loops
            // cb = 1 - don't breaker
            // cb = 0 - break
                let cb := 1

                let mc := add(_preBytes, 0x20)
                let end := add(mc, length)

                for {
                    let cc := add(_postBytes, 0x20)
                // the next line is the loop condition:
                // while(uint256(mc < end) + cb == 2)
                } eq(add(lt(mc, end), cb), 2) {
                    mc := add(mc, 0x20)
                    cc := add(cc, 0x20)
                } {
                // if any of these checks fails then arrays are not equal
                    if iszero(eq(mload(mc), mload(cc))) {
                    // unsuccess:
                        success := 0
                        cb := 0
                    }
                }
            }
            default {
            // unsuccess:
                success := 0
            }
        }

        return success;
    }

    /* @notice              Slice the _bytes from _start index till the result has length of _length
                            Refer from https://github.com/summa-tx/bitcoin-spv/blob/master/solidity/contracts/BytesLib.sol#L246
    *  @param _bytes        The original bytes needs to be sliced
    *  @param _start        The index of _bytes for the start of sliced bytes
    *  @param _length       The index of _bytes for the end of sliced bytes
    *  @return              The sliced bytes
    */
    function slice(
        bytes memory _bytes,
        uint _start,
        uint _length
    )
    internal
    pure
    returns (bytes memory)
    {
        require(_bytes.length >= (_start + _length));

        bytes memory tempBytes;

        assembly {
            switch iszero(_length)
            case 0 {
            // Get a location of some free memory and store it in tempBytes as
            // Solidity does for memory variables.
                tempBytes := mload(0x40)

            // The first word of the slice result is potentially a partial
            // word read from the original array. To read it, we calculate
            // the length of that partial word and start copying that many
            // bytes into the array. The first word we copy will start with
            // data we don't care about, but the last `lengthmod` bytes will
            // land at the beginning of the contents of the new array. When
            // we're done copying, we overwrite the full first word with
            // the actual length of the slice.
            // lengthmod <= _length % 32
                let lengthmod := and(_length, 31)

            // The multiplication in the next line is necessary
            // because when slicing multiples of 32 bytes (lengthmod == 0)
            // the following copy loop was copying the origin's length
            // and then ending prematurely not copying everything it should.
                let mc := add(add(tempBytes, lengthmod), mul(0x20, iszero(lengthmod)))
                let end := add(mc, _length)

                for {
                // The multiplication in the next line has the same exact purpose
                // as the one above.
                    let cc := add(add(add(_bytes, lengthmod), mul(0x20, iszero(lengthmod))), _start)
                } lt(mc, end) {
                    mc := add(mc, 0x20)
                    cc := add(cc, 0x20)
                } {
                    mstore(mc, mload(cc))
                }

                mstore(tempBytes, _length)

            //update free-memory pointer
            //allocating the array padded to 32 bytes like the compiler does now
                mstore(0x40, and(add(mc, 31), not(31)))
            }
            //if we want a zero-length slice let's just return a zero-length array
            default {
                tempBytes := mload(0x40)

                mstore(0x40, add(tempBytes, 0x20))
            }
        }

        return tempBytes;
    }


    /**
     * @dev Returns true if `account` is a contract.
     *      Refer from https://github.com/OpenZeppelin/openzeppelin-contracts/blob/master/contracts/utils/Address.sol#L18
     *
     * This test is non-exhaustive, and there may be false-negatives: during the
     * execution of a contract's constructor, its address will be reported as
     * not containing a contract.
     *
     * IMPORTANT: It is unsafe to assume that an address for which this
     * function returns false is an externally-owned account (EOA) and not a
     * contract.
     */
    function isContract(address account) internal view returns (bool) {
        // This method relies in extcodesize, which returns 0 for contracts in
        // construction, since the code is only stored at the end of the
        // constructor execution.

        // According to EIP-1052, 0x0 is the value returned for not-yet created accounts
        // and 0xc5d2460186f7233c927e7db2dcc703c0e500b653ca82273b7bfad8045d85a470 is returned
        // for accounts without code, i.e. `keccak256('')`
        bytes32 codehash;
        bytes32 accountHash = 0xc5d2460186f7233c927e7db2dcc703c0e500b653ca82273b7bfad8045d85a470;
        // solhint-disable-next-line no-inline-assembly
        assembly {codehash := extcodehash(account)}
        return (codehash != 0x0 && codehash != accountHash);
    }


    /**
   * @dev Convert an hexadecimal character to their value
   * @param c char
   */
    function fromHexChar(uint8 c) public pure returns (uint8) {
        if (byte(c) >= byte('0') && byte(c) <= byte('9')) {
            return c - uint8(byte('0'));
        }
        if (byte(c) >= byte('a') && byte(c) <= byte('f')) {
            return 10 + c - uint8(byte('a'));
        }
        if (byte(c) >= byte('A') && byte(c) <= byte('F')) {
            return 10 + c - uint8(byte('A'));
        }
        revert();
    }

    /**
    * @dev  Convert an hexadecimal string to raw bytes
    * @param s string
    */
    function fromHex(string memory s) public pure returns (bytes memory) {
        bytes memory ss = bytes(s);
        require(ss.length % 2 == 0);
        // length must be even
        bytes memory r = new bytes(ss.length / 2);
        for (uint i = 0; i < ss.length / 2; ++i) {
            r[i] = byte(fromHexChar(uint8(ss[2 * i])) * 16 +
                fromHexChar(uint8(ss[2 * i + 1])));
        }
        return r;
    }

    /**
    * @dev  Convert uint to string
    * @param _i uint
    */
    function uint2str(uint _i) internal pure returns (string memory _uintAsString) {
        if (_i == 0) {
            return "0";
        }
        uint j = _i;
        uint len;
        while (j != 0) {
            len++;
            j /= 10;
        }
        bytes memory bstr = new bytes(len);
        uint k = len - 1;
        while (_i != 0) {
            bstr[k--] = byte(uint8(48 + _i % 10));
            _i /= 10;
        }
        return string(bstr);
    }

    /**
    * @dev  Convert string to lowercase
    * @param str string
    */
    function toLower(string memory str) public pure returns (string memory) {
        bytes memory bStr = bytes(str);
        bytes memory bLower = new bytes(bStr.length);
        for (uint i = 0; i < bStr.length; i++) {
            // Uppercase character...
            uint8 c = uint8(bStr[i]);
            if ((c >= 65) && ( c <= 90)) {
                // So we add 32 to make it lowercase
                bLower[i] = bytes1(c + 32);
            } else {
                bLower[i] = bStr[i];
            }
        }
        return string(bLower);
    }
}

contracts/DidUtils.sol.content:
// SPDX-License-Identifier: LGPL-3.0-or-later
pragma solidity >=0.6.0 <0.7.0;
pragma experimental ABIEncoderV2;

import "./BytesUtils.sol";

library DidUtils {

    // example: did:etho:5Ee76017be7F983a520a778B413758A9DB49cBe9
    /**
   * @dev verify did format
   * @param did did
   */
    function verifyDIDFormat(string memory did) public pure returns (bool){
        bytes memory didData = bytes(did);
        if (didData.length != 49) {
            return false;
        }
        bytes memory prefix = bytes("did:etho:");
        if (!BytesUtils.equal(BytesUtils.slice(didData, 0, prefix.length), prefix)) {
            return false;
        }
        bytes memory addressBytesData = BytesUtils.slice(didData, prefix.length, didData.length - prefix.length);
        bytes memory addressBytes = BytesUtils.fromHex(string(addressBytesData));
        return addressBytes.length == 20;
    }

    function parseAddrFromDID(bytes memory did) public pure returns (address){
        uint prefixLen = 9;
        bytes memory addressBytesData = BytesUtils.slice(did, prefixLen, did.length - prefixLen);
        bytes memory addressBytes = BytesUtils.fromHex(string(addressBytesData));
        return BytesUtils.bytesToAddress(addressBytes);
    }

    /**
   * @dev parse public key to address
   * @param pubKey public key
   */
    function pubKeyToAddr(bytes memory pubKey) public pure returns (address){
        return address(uint(keccak256(pubKey)));
    }
}

contracts/IDid.sol.content:
// SPDX-License-Identifier: LGPL-3.0-or-later
pragma solidity >=0.6.0 <0.7.0;
pragma experimental ABIEncoderV2;


// define the interface and event of Did in this interface
interface IDid {

    event Deactivate(string did);

    function deactivateID(string calldata did, bytes calldata singer) external;


    event AddKey(string did, bytes pubKey, string[] controller);

    function addKey(string calldata did, bytes calldata newPubKey, string[] calldata pubKeyController,
        bytes calldata singer) external;

    event AddAddr(string did, address addr, string[] controller);

    function addAddr(string calldata did, address addr, string[] calldata pubKeyController,
        bytes calldata singer) external;


    event DeactivateKey(string did, bytes pubKey);

    function deactivateKey(string calldata did, bytes calldata pubKey, bytes calldata singer) external;

    event DeactivateAddr(string did, address addr);

    function deactivateAddr(string calldata did, address addr, bytes calldata singer) external;


    event AddNewAuthKey(string did, bytes pubKey, string[] controller);

    function addNewAuthKey(string calldata did, bytes calldata pubKey, string[] calldata controller,
        bytes calldata singer) external;

    function addNewAuthKeyByController(string calldata did, bytes calldata pubKey, string[] calldata controller,
        string calldata controllerSigner, bytes calldata singer) external;

    event AddNewAuthAddr(string did, address addr, string[] controller);

    function addNewAuthAddr(string calldata did, address addr, string[] calldata controller,
        bytes calldata singer) external;

    function addNewAuthAddrByController(string calldata did, address addr, string[] calldata controller,
        string calldata controllerSigner, bytes calldata singer) external;


    event SetAuthKey(string did, bytes pubKey);

    function setAuthKey(string calldata did, bytes calldata pubKey, bytes calldata singer) external;

    function setAuthKeyByController(string calldata did, bytes calldata pubKey, string calldata controller,
        bytes calldata singer) external;

    event SetAuthAddr(string did, address addr);

    function setAuthAddr(string calldata did, address addr,
        bytes calldata singer) external;

    function setAuthAddrByController(string calldata did, address addr, string calldata controller,
        bytes calldata singer) external;


    event DeactivateAuthKey(string did, bytes pubKey);

    function deactivateAuthKey(string calldata did, bytes calldata pubKey, bytes calldata singer) external;

    function deactivateAuthKeyByController(string calldata did, bytes calldata pubKey, string calldata controller,
        bytes calldata singer) external;

    event DeactivateAuthAddr(string did, address addr);

    function deactivateAuthAddr(string calldata did, address addr, bytes calldata singer) external;

    function deactivateAuthAddrByController(string calldata did, address addr, string calldata controller,
        bytes calldata singer) external;


    event AddContext(string did, string context);

    function addContext(string calldata did, string[] calldata context, bytes calldata singer) external;


    event RemoveContext(string did, string context);

    function removeContext(string calldata did, string[] calldata context, bytes calldata singer) external;


    event AddService(string did, string serviceId, string serviceType, string serviceEndpoint);

    function addService(string calldata did, string calldata serviceId, string calldata serviceType,
        string calldata serviceEndpoint, bytes calldata singer) external;


    event UpdateService(string did, string serviceId, string serviceType, string serviceEndpoint);

    function updateService(string calldata did, string calldata serviceId, string calldata serviceType,
        string calldata serviceEndpoint, bytes calldata singer) external;


    event RemoveService(string did, string serviceId);

    function removeService(string calldata did, string calldata serviceId, bytes calldata singer) external;


    event AddController(string did, string controller);

    function addController(string calldata did, string calldata controller, bytes calldata singer) external;


    event RemoveController(string did, string controller);

    function removeController(string calldata did, string calldata controller, bytes calldata singer) external;
}

contracts/IterableMapping.sol.content:
// SPDX-License-Identifier: LGPL-3.0-or-later
pragma solidity ^0.6.0;

library IterableMapping {

    struct IndexValue {uint keyIndex; bytes value;}

    struct KeyFlag {bytes32 key; bool deleted;}

    struct itmap {
        mapping(bytes32 => IndexValue) data;
        KeyFlag[] keys;
        uint size;
    }

    function insert(itmap storage self, bytes32 key, bytes memory value) internal returns (bool replaced) {
        uint keyIndex = self.data[key].keyIndex;
        self.data[key].value = value;
        if (keyIndex > 0)
            return true;
        else {
            keyIndex = self.keys.length;
            self.keys.push();
            self.data[key].keyIndex = keyIndex + 1;
            self.keys[keyIndex].key = key;
            self.size++;
            return false;
        }
    }

    function remove(itmap storage self, bytes32 key) internal returns (bool success) {
        uint keyIndex = self.data[key].keyIndex;
        if (keyIndex == 0)
            return false;
        delete self.data[key];
        self.keys[keyIndex - 1].deleted = true;
        self.size --;
        return true;
    }

    function contains(itmap storage self, bytes32 key) internal view returns (bool) {
        return self.data[key].keyIndex > 0;
    }

    function iterate_start(itmap storage self) internal view returns (uint keyIndex) {
        return iterate_next(self, uint(- 1));
    }

    function iterate_valid(itmap storage self, uint keyIndex) internal view returns (bool) {
        return keyIndex < self.keys.length;
    }

    function iterate_next(itmap storage self, uint keyIndex) internal view returns (uint r_keyIndex) {
        keyIndex++;
        while (keyIndex < self.keys.length && self.keys[keyIndex].deleted)
            keyIndex++;
        return keyIndex;
    }

    function iterate_get(itmap storage self, uint keyIndex) internal view returns (bytes32 key, bytes memory value) {
        key = self.keys[keyIndex].key;
        value = self.data[key].value;
    }
}

contracts/KeyUtils.sol.content:
// SPDX-License-Identifier: LGPL-3.0-or-later
pragma solidity >=0.6.0 <0.7.0;
pragma experimental ABIEncoderV2;

import "./BytesUtils.sol";

library KeyUtils {

    function genContextKey(string memory did) public pure returns (string memory){
        return string(abi.encodePacked(did, "@context"));
    }

    function genContextSecondKey(string memory ctx) public pure returns (bytes32){
        return keccak256(bytes(ctx));
    }

    function genPubKeyListKey(string memory did) public pure returns (string memory){
        return string(abi.encodePacked(did, "publicKey"));
    }

    function genPubKeyListSecondKey(bytes memory pubKey) public pure returns (bytes32){
        return keccak256(pubKey);
    }

    function genControllerKey(string memory did) public pure returns (string memory) {
        return string(abi.encodePacked(did, "controller"));
    }

    function genControllerSecondKey(string memory controller) public pure returns (bytes32){
        return keccak256(bytes(controller));
    }

    function genServiceKey(string memory did) public pure returns (string memory) {
        return string(abi.encodePacked(did, "service"));
    }

    function genServiceSecondKey(string memory serviceId) public pure returns (bytes32) {
        return keccak256(bytes(serviceId));
    }

    function genUpdateTimeKey(string memory did) public pure returns (string memory) {
        return string(abi.encodePacked(did, "updateTime"));
    }

    function genUpdateTimeSecondKey() public pure returns (bytes32) {
        // return keccak256("updateTime");
        return 0xc82895c0c3ceabd782a01504a94c9aacea049cda0758a362503092064cb5015f;
    }
}

